import React, { useState } from "react";
import Registration from "./component/registration";
import Login from "./component/login";
function App() {
  const [isChangeLoginType, setIsSetLoginType] = useState(false);
  return (
    <div className="App">
      {isChangeLoginType ? <Login /> : <Registration />}
    </div>
  );
}

export default App;
